//autogenerated:yes
//nolint:revive,govet,errcheck
package marsh

import (
	"testing"

	"github.com/stretchr/testify/require"
)

func TestEnum_CONTROL_AXIS(t *testing.T) {
	t.Run("zero", func(t *testing.T) {
		var e CONTROL_AXIS
		e.UnmarshalText([]byte{})
		e.MarshalText()
		e.String()
	})

	t.Run("first entry", func(t *testing.T) {
		enc, err := CONTROL_AXIS_ROLL.MarshalText()
		require.NoError(t, err)

		var dec CONTROL_AXIS
		err = dec.UnmarshalText(enc)
		require.NoError(t, err)

		require.Equal(t, CONTROL_AXIS_ROLL, dec)
	})
}
